import React, { Component } from "react";
import Arm from "./Buttons/Arm";
import Takeoff from "./Buttons/Takeoff";
import Land from "./Buttons/Land";
import Hover from "./Buttons/Hover";
import Disarm from "./Buttons/Disarm";
import { Row, Col, Container, Button } from "react-bootstrap";

class Control extends Component {
  state = { isArmed: true };

  isArmed = this.state.isArmed;

  render() {
    return (
      <div className="d-grid gap-2">
        <Row>{this.isArmed ? <Arm></Arm> : <Disarm></Disarm>}</Row>
        <Row>
          <Disarm></Disarm>
        </Row>
        <Row>
          <Takeoff></Takeoff>
        </Row>
        <Row>
          <Land></Land>
        </Row>
        <Row>
          <Hover></Hover>
        </Row>
      </div>
    );
  }
}

export default Control;
